import React , {Component} from 'react';
import TableHead from './TableHead'
import 'bootstrap/dist/css/bootstrap.min.css';
class Table extends Component {
    constructor(props){
        super(props)
    }
    render(){
        return(
            <table className="table table-dark">
                <TableHead />

            </table>
        )
    }
}
export default Table
